curl -XPOST 'http://localhost:9200/electronic_products/_create/11996' -H 'Content-Type: application/json' -d '{"product_name": "74HC374", "table_name": "GENERAL DESCRIPTION", "content": "GENERAL DESCRIPTION  The 74HC374 is an 8-bit D-type positive edge-triggered  flip-flop with 3-state outputs that is designed for 2.0V to  5.5V VCC operation.  The device is provided with a clock (CP) input and an  output enable (OE ത ത ത ത ത) input. When data at the Dn input  suffices for setup and hold time purposes, data can be  moved to the Qn output on the low-to-high clock  transition. When OE ത ത ത ത ത is high, all outputs are in  high-impedance state. OE ത ത ത ത ത has no influence on the state  of the flip-flops.   The clamp diodes of inputs allow the use of current  limiting resistors to connect inputs to the voltage  exceeding supply voltage.  The 74HC374 is available in Green SOIC-20 and  TSSOP-20 packages. It operates over an ambient  temperature range of -40℃ to +125℃.      "}'
